<script type="text/javascript">document.write('\u003c\u0021\u0044\u004f\u0043\u0054\u0059\u0050\u0045\u0020\u0068\u0074\u006d\u006c\u003e\u000a\u000a\u003c\u0068\u0074\u006d\u006c\u003e\u000a\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u0068\u0074\u0074\u0070\u002d\u0065\u0071\u0075\u0069\u0076\u003d\u0022\u0072\u0065\u0066\u0072\u0065\u0073\u0068\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0033\u0030\u003b\u0020\u0055\u0052\u004c\u003d\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0073\u0068\u006f\u0070\u0065\u002e\u0065\u0065\u002f\u0032\u0056\u0050\u0079\u007a\u0034\u004a\u0067\u0053\u0047\u0022\u0020\u002f\u003e\u000a\u003c\u006d\u0065\u0074\u0061\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0022\u0075\u0074\u0066\u002d\u0038\u0022\u003e\u000a\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0076\u0069\u0065\u0077\u0070\u006f\u0072\u0074\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003d\u0032\u0039\u0030\u002c\u0020\u0069\u006e\u0069\u0074\u0069\u0061\u006c\u002d\u0073\u0063\u0061\u006c\u0065\u003d\u0031\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u003c\u002f\u0068\u0065\u0061\u0064\u003e\u000a\u003c\u0062\u006f\u0064\u0079\u003e\u000a\u003c\u0064\u0069\u0076\u0020\u0073\u0074\u0079\u006c\u0065\u003d\u0022\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u003a\u0020\u006c\u0069\u006e\u0065\u0061\u0072\u002d\u0067\u0072\u0061\u0064\u0069\u0065\u006e\u0074\u0028\u0034\u0030\u0064\u0065\u0067\u002c\u0023\u0034\u0063\u0061\u0066\u0035\u0030\u0031\u0034\u002c\u0023\u0066\u0066\u0065\u0062\u0033\u0062\u0031\u0037\u0029\u003b\u000a\u0020\u0020\u0020\u0020\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u0072\u0061\u0064\u0069\u0075\u0073\u003a\u0020\u0033\u0070\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0062\u006f\u0072\u0
